import getAllPokemons from './pokemonInfo';

const getPokemonCards = async () => {
  const allData = await getAllPokemons();
  return allData.map(item => {
    const {
      id,
      name,
      types,
      imageURL
    } = item;
    return {
      id,
      name,
      types,
      imageURL
    };
  });
};

export default getPokemonCards;
